import React from 'react';
import './Form.css';

const Form = ({ handleSubmit, value }) => (

    <>
        <form className="myForm" onSubmit={handleSubmit}>
            <label htmlFor="filter">Nom du Pokemon</label>
            <br></br>
            <input id="filter" type="text" name="filter"/>
            <input type="submit" value="" className="Search">
            </input>
        </form>
        <p>{value}</p>
    </>
);

export default Form;
